    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIApiDiagnosticApi::apiDiagnosticUpdateCallback);
    connect(this, &OAIApiDiagnosticApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });
    _OauthMethod = 1;
    _implicitFlow.link();
    _passwordFlow.unlink();
    _authFlow.unlink();
    _credentialFlow.unlink();
    QStringList scope;
